import React, { useState } from 'react';

const IntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<{
    fullName: string;
    dateOfBirth: string;
    gender: string;
    email: string;
    phone: string;
    countryOfOrigin: string;
    dateOfArrival: string;
    immigrationStatus: string;
    supportNeeds: Record<string, boolean | string>;
    emergencyContact: {
      name: string;
      relationship: string;
      phone: string;
      email: string;
    };
    additionalNotes: string;
  }>({
    fullName: '',
    dateOfBirth: '',
    gender: '',
    email: '',
    phone: '',
    countryOfOrigin: '',
    dateOfArrival: '',
    immigrationStatus: '',
    supportNeeds: {
      employment: false,
      housing: false,
      education: false,
      languageClasses: false,
      other: '',
    },
    emergencyContact: {
      name: '',
      relationship: '',
      phone: '',
      email: '',
    },
    additionalNotes: '',
  });

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleCheckboxChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, checked } = e.target;
    setFormData((prev) => ({
      ...prev,
      supportNeeds: {
        ...prev.supportNeeds,
        [name]: checked,
      },
    }));
  };

  const handleEmergencyContactChange = (field: keyof typeof formData['emergencyContact'], value: string) => {
    setFormData((prev) => ({
      ...prev,
      emergencyContact: {
        ...prev.emergencyContact,
        [field]: value,
      },
    }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    // Add submission logic here (e.g., API call)
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-6 max-w-3xl mx-auto bg-white p-8 shadow-lg rounded-lg">
      <h2 className="text-2xl font-bold text-indigo-900 mb-4">Intake Form</h2>

      {/* Personal Details */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Full Name</label>
        <input
          type="text"
          name="fullName"
          value={formData.fullName}
          onChange={handleChange}
          className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500"
        />
      </div>

      <div className="grid grid-cols-1 sm:grid-cols-2 gap-6">
        <div>
          <label className="block text-sm font-medium text-gray-700">Date of Birth</label>
          <input
            type="date"
            name="dateOfBirth"
            value={formData.dateOfBirth}
            onChange={handleChange}
            className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500"
          />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Gender</label>
          <input
            type="text"
            name="gender"
            value={formData.gender}
            onChange={handleChange}
            className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500"
          />
        </div>
      </div>

      {/* Immigration Details */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Country of Origin</label>
        <input
          type="text"
          name="countryOfOrigin"
          value={formData.countryOfOrigin}
          onChange={handleChange}
          className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500"
        />
      </div>

      <div>
        <label className="block text-sm font-medium text-gray-700">Date of Arrival</label>
        <input
          type="date"
          name="dateOfArrival"
          value={formData.dateOfArrival}
          onChange={handleChange}
          className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500"
        />
      </div>

      <div>
        <label className="block text-sm font-medium text-gray-700">Immigration Status</label>
        <input
          type="text"
          name="immigrationStatus"
          value={formData.immigrationStatus}
          onChange={handleChange}
          className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500"
        />
      </div>

      {/* Support Needs */}
      <fieldset>
        <legend className="block text-sm font-medium text-gray-700">Support Needs</legend>
        <div className="mt-4 space-y-2">
          {['employment', 'housing', 'education', 'languageClasses'].map((need) => (
            <div key={need}>
              <label className="inline-flex items-center">
                <input
                  type="checkbox"
                  name={need}
                  checked={formData.supportNeeds[need]}
                  onChange={handleCheckboxChange}
                  className="rounded border-gray-300 text-indigo-600 shadow-sm focus:ring-indigo-500"
                />
                <span className="ml-2 capitalize">{need.replace(/([A-Z])/g, ' $1')}</span>
              </label>
            </div>
          ))}
        </div>
      </fieldset>

      {/* Emergency Contact */}
      <fieldset>
        <legend className="block text-sm font-medium text-gray-700">Emergency Contact</legend>
        <div className="mt-4 space-y-4">
          {(['name', 'relationship', 'phone', 'email'] as const).map((field) => (
            <div key={field}>
              <label className="block text-sm font-medium text-gray-700 capitalize">
                {field}
              </label>
              <input
                type="text"
                name={field}
                value={formData.emergencyContact[field]}
                onChange={(e) => handleEmergencyContactChange(field, e.target.value)}
                className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500"
              />
            </div>
          ))}
        </div>
      </fieldset>

      {/* Additional Notes */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Additional Notes</label>
        <textarea
          name="additionalNotes"
          value={formData.additionalNotes}
          onChange={handleChange}
          rows={4}
          className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-indigo-500 focus:border-indigo-500"
        />
      </div>

      <button
        type="submit"
        className="w-full bg-indigo-600 text-white py-2 px-4 rounded-md shadow hover:bg-indigo-700"
      >
        Submit
      </button>
    </form>
  );
};

export default IntakeForm;
